import React from 'react';
import logo from './logo.svg';
import pokemons from './data.js';
import './App.css';

function Teste() {
  const arrayPokemons = pokemons;
  const listPokemons = arrayPokemons.map((el) =>
    <li>{el.name}</li>
  );
  return (
    <ul>
      {listPokemons}
    </ul>
  );
}

function App() {
  return (
    <div>
      {pokemons.map(el => <Teste pokemon={el} />)}
    </div>
  );
}

export default App;
